import React, { Component } from 'react';

class Counter extends Component {
  state = { 
      count: 0,
      tags: ['tag1', 'tag2', 'tag3']

   } ;

   renderTags(){
       if (this.state.tags.length=== 0) return <p> there is no tags</p>
   }

    render() { 
        return (
        <div>
             <ul>
                 {this.state.tags.map(tag => <li key={tag}>{tag}</li>)}
             </ul>
        </div>);
    }

}
 
export default Counter;
